import React from 'react'
import Typography from '@material-ui/core/Typography';

export default function ResponsiveContent(props){

    return(
        <>
            <Typography variant="h4" component="h3" gutterBottom>
                {props.text.title}
            </Typography>
            <Typography paragraph>
                {props.content.text}
            </Typography> 
        </>
    )
}
